import React from 'react'; 
import { DataTable } from './components/table/DataTable';
import { store } from './store/store';

export const AdoptApp = () => {

    return (
        <Provider value={ store }>
            <h1>Adopt App</h1>
            <hr/>
            <DataTable/>
        </Provider>
    )
}
